  "call_control.inbound_routes.did_option_detail": "Spécifiez le modèle SDA à faire correspondre et faites passer l'appel entrant par cette voie d'acheminement. Les options sont:<br />- Motifs SDA : ajouter un ou plusieurs motifs SDA. Les appels qui correspondent au SDA défini seront acheminés vers la destination définie. Laissez ce champ vide pour faire correspondre les appels entrants avec une ou plusieurs informations SDA. <br />- Faire correspondre le modèle SDA aux extensions : utilisez le joker {{.Ext}} pour faire correspondre le numéro d'extension dans le modèle SDA. Si cette option est sélectionnée, vous devrez configurer la destination pour cet itinéraire entrant comme <b>Match Selected Extensions</b> et sélectionner les extensions autorisées à correspondre. Par exemple, si le modèle SDA est 550{{.Ext}} et que l'extension autorisée est 1000, les appels provenant du SDA 5501000 seront acheminés vers l'extension 1000, et les appels provenant du SDA 5502000 ne correspondront pas à cette règle.<br />- Faire correspondre la plage SDA à la plage des extensions : faire correspondre la plage SDA et la plage des extensions dans une correspondance biunivoque.  Si cette option est sélectionnée, vous devrez configurer la destination de cet itinéraire entrant comme suit : <b>Apparier l'appel SDA à l'extension de l'appel </b> et configurer le SDA et l'extension de l'appel. Par exemple, si la plage SDA est 5503301-5503305 et la plage d'extension est 1001-1005, les appels provenant de la plage SDA 5503301 seront acheminés vers 1001 et les appels provenant de la plage 5503302 seront acheminés vers 1002. <Dans les schémas SDA, les caractères suivants ont une signification particulière:<br />>- X correspond aux numéros 0-9;<br />- Z correspond aux numéros 1-9;<br />- N correspond aux numéros 2-9;<br />- [12345-9] correspond aux numéros entre parenthèses (dans cet exemple, 1, 2, 3, 4, 5, 6, 7, 8, 9);<br />- Joker \".\" correspond à un ou plusieurs numéros. Par exemple, \"9011.\" correspond à tout ce qui commence par 9011 (à l'exception de 9011 lui-même);<br />- Le caractère générique \" !\" correspond à aucun ou à plusieurs chiffres. Par exemple, \"9011 !\" correspond à tout ce qui commence par 9011 (y compris le 9011 lui-même) ;",
