  "call_control.outbound_routes.available_time_detail": "Sélectionnez la condition de temps pour permettre cet itinéraire sortant. Les options sont:<br />- Toujours : à tout moment, les postes autorisés peuvent passer des appels sortants par cet itinéraire sortant.<br />- Basé sur les heures de bureau globales : contrôlez l'itinéraire en fonction des heures de bureau et des jours fériés définis à l'écran <b>Contrôle des appels > Heures de bureau et jours fériés</b>. Vous pouvez déterminer si cet itinéraire doit être autorisé séparément pendant les heures de bureau, en dehors des heures de bureau et pendant les jours fériés. <br />- Basé sur les heures de bureau personnalisées : définissez une règle exclusive des heures de bureau pour cet itinéraire et contrôlez en conséquence. Vous pouvez décider d'autoriser ou non cet itinéraire séparément pendant les heures de bureau, en dehors des heures de bureau et pendant les jours fériés. Vous pouvez également décider d'autoriser ou non cet itinéraire pendant les jours fériés.",
  "call_control.outbound_routes.available_time_err": "Cet itinéraire sortant ne sera pas disponible à tout moment. Êtes-vous sûr de sauvegarder les paramètres ?",
