  "call_control.outbound_routes.dial_patterns": "Paramètres de correspondance des numéros",
  "call_control.outbound_routes.dial_patterns_detail": "Les appels sortants qui correspondent à ce schéma de numérotation utiliseront cette voie de sortie. <Dans les modèles, les caractères suivants ont une signification particulière:<br /><br />- X correspond aux numéros 0-9;<br />- Z correspond aux numéros 1-9;<br />- N correspond aux numéros 2-9;<br />- [12345-9] correspond aux numéros dans la plage (dans cet exemple, 1, 2, 3, 4, 5, 6, 7, 8, 9);<br />- Le caractère générique \".\" correspond à un ou plusieurs numéros. Par exemple, \"9011.\" correspond à tout ce qui commence par 9011 (à l'exception de 9011 lui-même);<br />- Le caractère générique \" !\" pour les extensions SIP ne correspond à aucun ou à plusieurs caractères. Par exemple, \"9011\" correspond à toute extension SIP commençant par 9011 (y compris le 9011 lui-même) ; pour les extensions FXS, il est utilisé pour la numérotation en chevauchement. Le PBX composera le numéro une fois que le numéro sera complet et dès qu'il y aura une correspondance non ambiguë. Par exemple, avec \"9011 !\", lorsque les extensions SXF composent le 9011, le PBX composera immédiatement le numéro : Le strip vous permet de spécifier le nombre de chiffres qui seront retirés du devant du numéro de téléphone avant que l'appel ne soit passé. Par exemple, si vous devez appuyer sur 0 avant de composer un numéro de téléphone, un chiffre doit être supprimé de la chaîne de numérotation avant que l'appel ne soit passé.<br /><br />Prepend : ces chiffres seront ajoutés au numéro de téléphone avant que l'appel ne soit passé. Par exemple, si une ligne téléphonique nécessite une numérotation à 10 chiffres, mais que les utilisateurs sont plus à l'aise avec une numérotation à 7 chiffres, ce champ peut être utilisé pour ajouter un indicatif régional à 3 chiffres à tous les numéros de téléphone à 7 chiffres avant de passer l'appel. ",
