  "call_features.feature_codes.office_time": "Changement de statut des heures d'ouverture",
  "call_features.feature_codes.office_time_detail": "Si ce code de fonction est activé, les postes autorisés peuvent composer le code de fonction pour commuter le système téléphonique pendant ou en dehors des heures de bureau. Le code de fonction par défaut est *99. Il est activé par défaut. \n\nRemarque : les postes peuvent également surveiller et commuter l'état des Heures de bureau en configurant la touche BLF sur le téléphone IP. La valeur de la touche BLF est le code de fonction. Lorsque l'abonnement a réussi, vous pouvez appuyer sur la touche BLF pour changer directement de statut ; le voyant BLF s'allume en vert pendant les heures de bureau et en rouge en dehors des heures de bureau.",
