  "call_features.feature_codes.paging": "Intercom",
  "call_features.feature_codes.paging_detail": "Si ce code de fonction est activé, les postes peuvent composer le code de la fonction et un numéro de poste pour appeler ce poste. Le code de fonction par défaut est *6. Elle est activé par défaut.",
