  "extension_trunk.trunks.diversion_user_part": "Diversion",
  "extension_trunk.trunks.diversion_user_part_detail": "Définissez la valeur dans le champ d'en-tête Diversion du paquet SIP INVITE pour les appels sortants de ce trunk. Cette configuration nécessite une connaissance professionnelle du protocole SIP, car des configurations incorrectes peuvent entraîner des problèmes d'appel. <br />\n<br />SIP Register Trunk Setting Options :\n<br />- [Par défaut] : l'ordre de priorité de la valeur sera Outbound Route Outbound Caller ID → Extension Outbound Caller ID → Trunk Outbound Caller ID → Trunk Username → Extension Caller ID → The Originator Caller ID.\n<br />- [None] : ne pas envoyer ce paramètre avec le paquet SIP INVITE.\n<br />- Outbound Route Outbound Caller ID : l'ID de l'appelant sortant configuré dans <b>Call Control > Outbound Route</b>.\n<br />- Extension Outbound Caller ID : l'identification de l'appelant sortant de l'extension associée au réseau.\n<br />- Trunk Outbound Caller ID : l'identification de l'appelant sortant configurée dans <b> Extension/Trunk > Trunk > Outbound Caller ID > Général</b>.\n<br />- Trunk Username : le nom d'utilisateur du trunk configuré dans <b>Extension/trunk > trunk > Authentification</b>\n<br />- Extension Caller ID : l'ID de l'appelant configuré dans <b> Extension/Trunk > Extension > User > Extension Information</b>, qui est le même que le numéro d'extension par défaut. \n<br />- Identification de l'appelant : le numéro d'identification de l'appelant du demandeur (le premier appelant dans le cas où l'appel est transféré). Si le demandeur est un numéro externe, le numéro externe sera pris. Si le demandeur est une extension, l'ordre de priorité est le suivant : Extension Outbound Caller ID → [par défaut]. \n<br />- Custom : définir une valeur personnalisée.<br />\n\n<br />Options de paramétrage du trunk de pair SIP et du trunk de compte SIP :\n<br />- [Par défaut] : l'ordre de priorité sera l'identification de l'appelant sortant → Extension Outbound Caller ID → Trunk Outbound Caller ID → Extension Caller ID → The Originator Caller ID.\n<br />- [Aucune] : n'envoyez pas ce paramètre avec le paquet SIP INVITE.\n<br />- Outbound Route Outbound Caller ID : l'identification de l'appelant sortant configurée dans <b>Call Control > Outbound Route</b>.\n<br />- Extension Outbound Caller ID : l'identification de l'appelant sortant de l'extension associée au réseau.\n<br />- Trunk Outbound Caller ID : l'identification de l'appelant sortant configurée dans <b> Extension/Trunk > Trunk > Outbound Caller ID > Général</b>.\n<br />- Extension Caller ID : l'identification de l'appelant configurée dans <b> Extension/trunk > Extension > Utilisateur > Information sur l'extension</b>, qui est la même que le numéro d'extension par défaut. \n<br />- Identification de l'appelant : le numéro d'identification de l'appelant du demandeur (le premier appelant dans le cas où l'appel est transféré). Si le demandeur est un numéro externe, le numéro externe sera pris. Si le demandeur est une extension, l'ordre de priorité est le suivant : Extension Outbound Caller ID → [par défaut]. \n<br />- Custom : définir une valeur personnalisée.<br />",
