  "extension_trunk.trunks.dtmf_mode": "Mode DTMF",
  "extension_trunk.trunks.dtmf_mode_detail": "Définissez le mode d'envoi des tonalités DTMF. Les options sont les suivantes : <br />- RFC4733 (RFC2833) : La DTMF sera transportée dans le flux RTP dans des paquets RTP différents de ceux du signal audio. <br />- Info : Le DTMF sera transporté dans les messages SIP Info. <br />- Inband : Le DTMF sera transporté dans le signal audio. <br />- Auto : le PBX détectera si l'appareil prend en charge la DTMF RFC4733 (RFC2833). Si le RFC4733 (RFC2833) est pris en charge, il choisira RFC4733 (RFC2833) ; sinon, il choisira Inband. <br />Le mode par défaut est RFC4733 (RFC2833).",
