  "extension_trunk.trunks.from": "De",
  "extension_trunk.trunks.from_disp_name_part": "De la partie Nom d'affichage",
  "extension_trunk.trunks.from_disp_name_part_detail": "Tous les appels sortants de ce trunk SIP utiliseront le nom d'affichage From dans l'en-tête From du paquet SIP Invite. <br />- [Par défaut] : affiche le nom correspondant à l'identification de l'appelant sortant lorsqu'il est effectivement sortant;<br />- Nom de l'identification de l'appelant de l'extension : Ce nom d'identification de l'appelant est constitué de la combinaison du \"nom de famille\" et du \"prénom\" selon le \"format d'affichage du nom de préférence\";<br />- Nom d'identification de l'appelant sortant par défaut du trunk : le nom d'identification de l'appelant sortant par défaut du trunk;<br />- Nom d'identification de l'appelant sortant du poste dans le trunk : le nom de l'appelant sortant configuré pour être associé à l'extension dans le trunk;<br />- Nom de l'appelant d'origine : le numéro d'identification du premier appelant dans le cas où l'appel est transféré et le nom de l'appelant dépend de [Dafault] lors d'un appel direct;<br />- Personnalisé : la valeur personalisée par l'administrateur.",
  "extension_trunk.trunks.from_host_part": "From Host Part",
  "extension_trunk.trunks.from_user_part": "From User Part",
  "extension_trunk.trunks.from_user_part_detail": "Définissez la valeur dans le champ d'en-tête From du paquet SIP INVITE pour les appels sortants de ce trunk. Cette configuration nécessite une connaissance professionnelle du protocole SIP, car des configurations incorrectes peuvent entraîner des problèmes d'appel. <br />\n<br />SIP Register Trunk Setting Options :\n<br />- [Par défaut] : l'ordre de priorité sera l'identification de l'appelant sortant → Extension Outbound Caller ID → Trunk Outbound Caller ID → Trunk Username → Extension Caller ID → The Originator Caller ID.\n<br />- Outbound Route Outbound Caller ID : l'identification de l'appelant sortant configurée dans <b>Call Control > Outbound Route</b>.\n<br />- Extension Outbound Caller ID : l'identification de l'appelant sortant de l'extension associée au réseau.\n<br />- Trunk Outbound Caller ID : l'identification de l'appelant sortant configurée dans <b>Extension/Trunk > Trunk > Outbound Caller ID > Général</b>.\n<br />- Trunk Username : le nom d'utilisateur du trunk configuré dans <b>Extension/trunk > trunk > Nom d'utilisateur</b>\n<br />- Extension Caller ID : l'ID de l'appelant configuré dans le <b> Extension/Trunk > Extension > User > Extension Information</b>, qui est le même que le numéro d'extension par défaut. \n<br />- Identification de l'appelant : le numéro d'identification de l'appelant du demandeur (le premier appelant dans le cas où l'appel est transféré). Si le demandeur est un numéro externe, le numéro externe sera pris. Si le demandeur est une extension, l'ordre de priorité est le suivant : Extension Outbound Caller ID → [par défaut]. \n<br />- Custom : définir une valeur personnalisée.<br />\n\n<br />Options de paramétrage du trunk de pair SIP et du trunk de compte SIP :\n<br />- [Par défaut] : l'ordre de priorité sera l'identification de l'appelant sortant → Extension Outbound Caller ID → Trunk Outbound Caller ID → Extension Caller ID → The Originator Caller ID.\n<br />- Outbound Route Outbound Caller ID : l'identification de l'appelant sortant configurée dans <b>Call Control > Outbound Route</b>.\n<br />- Extension Outbound Caller ID : l'identification de l'appelant sortant de l'extension associée au réseau.\n<br />- Trunk Outbound Caller ID : l'identification de l'appelant sortant configurée dans <b>Extension/Trunk > Trunk > Outbound Caller ID > Général</b>.\n<br />- Extension Caller ID : l'identification de l'appelant configurée dans <b>Extension/Tranche > Extension > Utilisateur > Information sur l'extension</b>, qui est la même que le numéro d'extension par défaut. \n<br />- Identification de l'appelant : le numéro d'identification de l'appelant du demandeur (le premier appelant dans le cas où l'appel est transféré). Si le demandeur est un numéro externe, le numéro externe sera pris. Si le demandeur est une extension, l'ordre de priorité est le suivant : Extension Outbound Caller ID → [par défaut]. \n<br />- Custom : définir une valeur personnalisée.<br />",
