  "extension_trunk.trunks.outbound_cid_type_detail": "Les options sont les suivantes : <br /> - Shared Outbound Caller ID : associer un numéro d'appel sortant fixe à un ou plusieurs postes ou groupes de postes, ou utiliser le caractère générique {{.Ext}} pour faire correspondre le numéro de poste au numéro d'appel sortant. Par exemple, définissez le modèle d'identification de l'appelant sortant comme 592550{{.Ext}} et sélectionnez les extensions 1000 et 9001 à y associer, puis, lorsque vous appelez depuis cette ligne, l'identification de l'appelant sortant sera 5925501000 pour l'extension 1000 et 5925509001 pour l'extension 9001.<br /> - Plage d'identification de l'appelant sortant : liez des identifications d'appelants sortants consécutifs à des extensions consécutives avec une correspondance biunivoque. Par exemple, définissez la plage d'identification de l'appelant sortant comme 5925503001-5925503005 et la plage de postes comme 1011-1015, puis, lorsque vous appelez depuis cette ligne, l'identification de l'appelant sortant sera 5925503001 pour le poste 1011, 5925503002 pour le poste 1012, et ainsi de suite.",
