  "extension_trunk.trunks.patterns": "Modèles",
  "extension_trunk.trunks.patterns_detail": "L'identifiant de l'appelant entrant qui correspond au modèle d'adaptation sera adapté, de sorte que vous puissiez appuyer sur l'enregistrement de l'appel directement sur votre téléphone pour rappeler un numéro.<br />Dans le modèle d'adaptation, les caractères suivants ont une signification particulière:<br />X correspond aux numéros 0-9;<br />Z correspond aux numéros 1-9 ;\n<br />N correspond aux chiffres 2 à 9;<br />[12345-9] correspond aux chiffres entre parenthèses (dans cet exemple, 1, 2, 3, 4, 5, 6, 7, 8, 9);<br />Wildcard &#34 ;.&#34 ; correspond à un ou plusieurs chiffres. Par exemple, &#34;9011.&#34 ; correspond à tout ce qui commence par 9011 (sauf 9011 lui-même);<br />Wildcard &#34;!&#34 ; ne correspond à aucun ou à plusieurs numéros. Par exemple, &#34;9011!&#34 ; correspond à tout ce qui commence par 9011 (y compris le 9011 lui-même).",
