  "plan.lcs.answer.done": "2. Sélectionnez {OEM.RemoteAccessServiceName} dans les paramètres de configuration du serveur {OEM.LinkusName}, cliquez sur Enregistrer, puis c'est terminé !",
  "plan.lcs.answer.path": "1. Allez à Extension et Trunk > Extension > Serveur {OEM.LinkusName}.",
