  "plan.lcs.explain": "Permet à {OEM.RemoteAccessServiceName} de bénéficier d'une connexion à distance {OEM.LinkusName} ininterrompue et sécurisée et rend un éventail complet d'options d'extension facilement accessibles sur les clients de bureau et mobiles {OEM.LinkusName}, partout et immédiatement !",
