  "plan.lcs.unused": "{0}{OEM.RemoteAccessServiceName}{1} est une fonction payante incluse dans le plan d'entreprise. Conçue pour le travail à distance, elle vous libère des risques de redirection de port, offre des connexions à distance sécurisées et rend un éventail complet de fonctions d'extension facilement accessibles pour votre équipe sur les clients de bureau et mobiles {OEM.LinkusName}, où qu'ils se trouvent. ",
  "plan.lcs.used": "Inclus dans l'Enterprise PLAN, {0}{OEM.RemoteAccessServiceName}{1} est un service à valeur ajoutée pour le travail à distance. Il vous libère des risques de redirection de port, offre des connexions à distance sécurisées et rend un éventail complet de fonctions d'extension facilement accessibles pour votre équipe sur les clients de bureau et mobiles {OEM.LinkusName}, où qu'ils se trouvent.",
  "plan.lcs.used_fqdn": "Votre abonnement est expiré. Le {OEM.RemoteAccessServiceName} est conçu pour configurer votre équipe pour une productivité n’importe où et n’importe quand instantanément et en toute sécurité. Il fournit un nom de domaine facile d’accès, protège l’accès Web à distance PBX et permet une expérience de communication unifiée dans le bureau cohérente avec les clients Linkus UC n’importe où, sur n’importe quel appareil.",
  "plan.lcs.used_fqdnno": "Votre abonnement est expiré. Le {OEM.RemoteAccessServiceName} est conçu pour configurer votre équipe pour une productivité n’importe où et n’importe quand instantanément et en toute sécurité. Il fournit un nom de domaine facile d’accès, protège l’accès Web à distance PBX et permet une expérience de communication unifiée dans le bureau cohérente avec les clients Linkus UC n’importe où, sur n’importe quel appareil.\n\nPour profiter du service, veuillez renouveler votre abonnement et configurer votre nom de domaine personnalisé PBX (FQDN) dans <b>le System > Network > Public IP and Ports</b>.",
  "plan.lcs.use_fqdn": "{OEM.RemoteAccessServiceName} est une solution de travail à distance clé en main basée sur l’abonnement. Il fournit un nom de domaine facile d’accès, protège l’accès web à distance PBX et permet à la main-d’œuvre distante de profiter d’une expérience de communication unifiée dans le bureau cohérente avec Linkus UC」 Clients n’importe où, sur n’importe quel appareil.",
